import{_ as e,o as r,c as a,Q as t}from"./chunks/framework.fb0c8ff2.js";const b=JSON.parse('{"title":"Error Codes","description":"","frontmatter":{},"headers":[],"relativePath":"guide/error-codes.md","filePath":"guide/error-codes.md","lastUpdated":1691359444000}'),o={name:"guide/error-codes.md"},n=t('<h1 id="error-codes" tabindex="-1">Error Codes <a class="header-anchor" href="#error-codes" aria-label="Permalink to &quot;Error Codes&quot;">​</a></h1><p>Below are possible error codes that may be generated when dealing with station data.</p><h2 id="onlinechargeautomationbr0001" tabindex="-1">OnlineChargeAutomationBR0001 <a class="header-anchor" href="#onlinechargeautomationbr0001" aria-label="Permalink to &quot;OnlineChargeAutomationBR0001&quot;">​</a></h2><p><strong>Error Message:</strong> <em>startTime</em> CANNOT be earlier than now!. <br><strong>Error Description:</strong> The startTime parameter cannot be retroactive. (Past data cannot be sent.)</p><h2 id="onlinechargeautomationbr0002" tabindex="-1">OnlineChargeAutomationBR0002 <a class="header-anchor" href="#onlinechargeautomationbr0002" aria-label="Permalink to &quot;OnlineChargeAutomationBR0002&quot;">​</a></h2><p><strong>Error Message:</strong> <em>endTime</em> CANNOT be earlier than or equal to startTime! <br><strong>Error Description:</strong> The <em>endTime</em> parameter cannot be before or the same as the <em>startTime</em> parameter. (The end time cannot be earlier than or the same as the start time.)</p><h2 id="onlinechargeautomationbr0003" tabindex="-1">OnlineChargeAutomationBR0003 <a class="header-anchor" href="#onlinechargeautomationbr0003" aria-label="Permalink to &quot;OnlineChargeAutomationBR0003&quot;">​</a></h2><p><strong>Error Message:</strong> NOT authorized for: &quot;SKT/123!&quot; <br><strong>Error Description:</strong> The user sending the data is not authorized for the specified socket. Charging network operators can only transact for the sockets of the stations connected to them.</p><h2 id="onlinechargeautomationbr0004" tabindex="-1">OnlineChargeAutomationBR0004 <a class="header-anchor" href="#onlinechargeautomationbr0004" aria-label="Permalink to &quot;OnlineChargeAutomationBR0004&quot;">​</a></h2><p><strong>Error Message:</strong> Operation is NOT PERMITTED on past records! <em>startTime</em> is set and before now! <br><strong>Error Description:</strong> Retroactive records cannot be deleted. No changes are allowed to a retrospective record. For example, a price or reservation information from last week cannot be changed or deleted today.</p><h2 id="onlinechargeautomationbr0005" tabindex="-1">OnlineChargeAutomationBR0005 <a class="header-anchor" href="#onlinechargeautomationbr0005" aria-label="Permalink to &quot;OnlineChargeAutomationBR0005&quot;">​</a></h2><p><strong>Error Message:</strong> Operation is NOT PERMITTED on past records! <em>endTime</em> is set and before now! <br><strong>Error Description:</strong> Retroactive records cannot be deleted. No changes are allowed to a retrospective record. For example, a price or reservation information from last week cannot be changed or deleted today.</p><h2 id="onlinechargeautomationbr0006" tabindex="-1">OnlineChargeAutomationBR0006 <a class="header-anchor" href="#onlinechargeautomationbr0006" aria-label="Permalink to &quot;OnlineChargeAutomationBR0006&quot;">​</a></h2><p><strong>Error Message:</strong> Range from <em>startTime</em> to <em>endTime</em> CANNOT be more than 31 days! <br><strong>Error Description:</strong> The start and end date range cannot exceed 31 days. (A maximum of 31 days of data can be queried.)</p><h2 id="onlinechargeautomationbr0007" tabindex="-1">OnlineChargeAutomationBR0007 <a class="header-anchor" href="#onlinechargeautomationbr0007" aria-label="Permalink to &quot;OnlineChargeAutomationBR0007&quot;">​</a></h2><p><strong>Error Message:</strong> <em>endTime</em> CANNOT be earlier than startTime! <br><strong>Error Description:</strong> During the query, the end date sent in the query criteria cannot be earlier than the start date.</p><h2 id="onlinechargeautomationbr0008" tabindex="-1">OnlineChargeAutomationBR0008 <a class="header-anchor" href="#onlinechargeautomationbr0008" aria-label="Permalink to &quot;OnlineChargeAutomationBR0008&quot;">​</a></h2><p><strong>Error Message:</strong> Invalid value: 114.59 price CANNOT be less than or equal to 0.00 or greater than 100.00! <br><strong>Error Description:</strong> The price should be between 0-100.</p><h2 id="onlinechargeautomationbr0009" tabindex="-1">OnlineChargeAutomationBR0009 <a class="header-anchor" href="#onlinechargeautomationbr0009" aria-label="Permalink to &quot;OnlineChargeAutomationBR0009&quot;">​</a></h2><p><strong>Error Message:</strong> Invalid value: 21.545785. price CANNOT have more decimal places than two. <br><strong>Error Description:</strong> The price can be a maximum of <em>2</em> digits after the comma.</p><h2 id="onlinechargeautomationbr0010" tabindex="-1">OnlineChargeAutomationBR0010 <a class="header-anchor" href="#onlinechargeautomationbr0010" aria-label="Permalink to &quot;OnlineChargeAutomationBR0010&quot;">​</a></h2><p><strong>Error Message:</strong> date CANNOT be earlier than tomorrow! <br> or <br> PriceInfo CANNOT be sent after <em>5 P.M.</em> for tomorrow! <br><strong>Error Description:</strong> The date of the price cannot be before tomorrow. <br> or <br> Tomorrow&#39;s price information cannot be sent after 17:00.</p><h2 id="onlinechargeautomationbr0011" tabindex="-1">OnlineChargeAutomationBR0011 <a class="header-anchor" href="#onlinechargeautomationbr0011" aria-label="Permalink to &quot;OnlineChargeAutomationBR0011&quot;">​</a></h2><p><strong>Error Message:</strong> CANNOT add PriceInfo. There is another record for specified date with ID : 123. Please update this record if you want to make changes. <br><strong>Error Description:</strong> Price information cannot be added for the same day. If price information has been sent for one day, a second price cannot be sent for the same day. If the price is to be changed, the record can be updated by specifying the ID information in the message.</p><h2 id="onlinechargeautomationbr0012" tabindex="-1">OnlineChargeAutomationBR0012 <a class="header-anchor" href="#onlinechargeautomationbr0012" aria-label="Permalink to &quot;OnlineChargeAutomationBR0012&quot;">​</a></h2><p><strong>Error Message:</strong> Operation is NOT PERMITTED on past records! <br> or \\ Operation is NOT PERMITTED after 5 P.M. for tomorrow! <br><strong>Error Description:</strong> Retroactive records cannot be changed. No changes are allowed to a retrospective record. For example, a price or reservation information from last week cannot be changed or deleted today. <br> or <br> Tomorrow&#39;s price information cannot be sent after 17:00.</p><h2 id="onlinechargeautomationbr0013" tabindex="-1">OnlineChargeAutomationBR0013 <a class="header-anchor" href="#onlinechargeautomationbr0013" aria-label="Permalink to &quot;OnlineChargeAutomationBR0013&quot;">​</a></h2><p><strong>Error Message:</strong> NOT authorized for : ŞRJ/123 ! <br><strong>Error Description:</strong> The user sending the data is not authorized for the specified Charging Station. Charging network operators can only transact for the Charging Stations connected to them.</p><h2 id="onlinechargeautomationbr0014" tabindex="-1">OnlineChargeAutomationBR0014 <a class="header-anchor" href="#onlinechargeautomationbr0014" aria-label="Permalink to &quot;OnlineChargeAutomationBR0014&quot;">​</a></h2><p><strong>Error Message:</strong> status CANNOT be <em>&#39;IN_USE&#39;</em> for this operation! Use another status value. <br><strong>Error Description:</strong> It is the message received when the &#39;IN_USE&#39; value is used other than the values specified for the status parameter in the addAvailabilityInfo method.</p><h2 id="onlinechargeautomationbr0015" tabindex="-1">OnlineChargeAutomationBR0015 <a class="header-anchor" href="#onlinechargeautomationbr0015" aria-label="Permalink to &quot;OnlineChargeAutomationBR0015&quot;">​</a></h2><p><strong>Error Message:</strong> startTime CANNOT be updated! Use the same startTime which is :”startTimeFromDB” <br><strong>Error Description:</strong> It is the message indicating that the current startTime value in the database should be used when the startTime parameter in the updateAvailabilityInfo method should not be updated.</p><h2 id="onlinechargeautomationbr0016" tabindex="-1">OnlineChargeAutomationBR0016 <a class="header-anchor" href="#onlinechargeautomationbr0016" aria-label="Permalink to &quot;OnlineChargeAutomationBR0016&quot;">​</a></h2><p><strong>Error Message:</strong> endTime CANNOT be before now! <br><strong>Error Description:</strong> The endTime parameter cannot be retroactive. (Cannot be before system clock.)</p><h2 id="onlinechargeautomationbr0017" tabindex="-1">OnlineChargeAutomationBR0017 <a class="header-anchor" href="#onlinechargeautomationbr0017" aria-label="Permalink to &quot;OnlineChargeAutomationBR0017&quot;">​</a></h2><p><strong>Error Message:</strong> CANNOT start IN_USE. Socket &quot;SKT/123&quot; has been in use already. First end IN_USE using record id: &quot;ID: 123&quot; <br><strong>Error Description:</strong> It is the message received when it is desired to send data indicating that the usage has started again before the usage status is terminated for a socket that is currently being used. First, it indicates that the use case should be terminated with the endInUse method for the record with the specified id.</p>',36),i=[n];function s(h,c,d,l,m,g){return r(),a("div",null,i)}const p=e(o,[["render",s]]);export{b as __pageData,p as default};
